import React from 'react';
import styled from 'styled-components';

const ServicesContainer = styled.div`
  padding: 4rem 2rem;
  max-width: 1200px;
  margin: 0 auto;
`;

const Title = styled.h1`
  color: #ffffff;
  text-align: center;
  margin-bottom: 3rem;
  font-size: 2.5rem;
`;

const ServicesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(300px, 1fr));
  gap: 2rem;
`;

const ServiceCard = styled.div`
  background: rgba(255, 255, 255, 0.1);
  backdrop-filter: blur(10px);
  border-radius: 1rem;
  padding: 2rem;
  color: #ffffff;
  opacity: 0;
  transform: translateY(20px);
  animation: fadeInUp 0.5s ease forwards;

  @keyframes fadeInUp {
    to {
      opacity: 1;
      transform: translateY(0);
    }
  }
`;

const ServiceTitle = styled.h3`
  color: #00f2fe;
  margin-bottom: 1rem;
`;

const ServiceDescription = styled.p`
  line-height: 1.6;
  opacity: 0.9;
`;

const Services: React.FC = () => {
  const services = [
    {
      title: 'Web Development',
      description: 'Custom web applications built with modern technologies and best practices.'
    },
    {
      title: 'Mobile Development',
      description: 'Native and cross-platform mobile applications for iOS and Android.'
    },
    {
      title: 'UI/UX Design',
      description: 'Beautiful and intuitive user interfaces designed with your users in mind.'
    },
    {
      title: 'Cloud Solutions',
      description: 'Scalable cloud infrastructure and deployment solutions.'
    },
    {
      title: 'DevOps',
      description: 'Continuous integration and deployment pipelines for efficient development.'
    },
    {
      title: 'Consulting',
      description: 'Expert advice and guidance for your technology projects.'
    }
  ];

  return (
    <ServicesContainer>
      <Title>Our Services</Title>
      <ServicesGrid>
        {services.map((service, index) => (
          <ServiceCard key={index} style={{ animationDelay: `${index * 0.1}s` }}>
            <ServiceTitle>{service.title}</ServiceTitle>
            <ServiceDescription>{service.description}</ServiceDescription>
          </ServiceCard>
        ))}
      </ServicesGrid>
    </ServicesContainer>
  );
};

export default Services;
